import React,{useState} from 'react';

const Boards = () => {
    const [boards,setBoards] = useState([
        {id:0,title:'ToDo',list:[{id:1,body:'Вытереть попу'}]},
        {id:1,title:'InProgress',list:[{id:1,body:'Помыть попу'}]},
        {id:2,title:'Done',list:[{id:1,body:'Покакать'}]}
    ])
    return (
        <div className='boards'>
            {boards.map(board=>
            <div className='boards__elem' key={board.id}>
                {board.list.map(task=>
                <div className='boards__task' key={task.id}>
                    {task.body}
                </div>)}
            </div>)}
        </div>
    );
};

export default Boards;
